import React from 'react';
import { useNavigate, useLocation } from 'react-router-dom';
import Logo from './Logo';

const Navbar = () => {
  const navigate = useNavigate();
  const location = useLocation();

  const handleLogout = () => {
    localStorage.removeItem('token');
    navigate('/');
  };

  const isActive = (path) => location.pathname === path;

  return (
    <nav className="navbar-cstech">
      <div style={{ 
        display: 'flex', 
        justifyContent: 'space-between', 
        alignItems: 'center', 
        maxWidth: '1200px', 
        margin: '0 auto',
        width: '100%'
      }}>
        <div onClick={() => navigate('/dashboard')} style={{ cursor: 'pointer' }}>
          <Logo size="md" showText={true} />
        </div>
        
        <div style={{ display: 'flex', gap: '10px' }}>
          <button
            className={`nav-link-cstech ${isActive('/dashboard') ? 'active' : ''}`}
            onClick={() => navigate('/dashboard')}
            style={{ background: 'none', border: 'none', cursor: 'pointer' }}
          >
            Dashboard
          </button>
          <button
            className={`nav-link-cstech ${isActive('/agents') ? 'active' : ''}`}
            onClick={() => navigate('/agents')}
            style={{ background: 'none', border: 'none', cursor: 'pointer' }}
          >
            Agents
          </button>
          <button
            className={`nav-link-cstech ${isActive('/upload') ? 'active' : ''}`}
            onClick={() => navigate('/upload')}
            style={{ background: 'none', border: 'none', cursor: 'pointer' }}
          >
            Upload
          </button>
          <button
            className={`nav-link-cstech ${isActive('/distributed') ? 'active' : ''}`}
            onClick={() => navigate('/distributed')}
            style={{ background: 'none', border: 'none', cursor: 'pointer' }}
          >
            Lists
          </button>
          <button
            className="nav-link-cstech"
            onClick={handleLogout}
            style={{ background: 'none', border: 'none', cursor: 'pointer' }}
          >
            Logout
          </button>
        </div>
      </div>
    </nav>
  );
};

export default Navbar;
